const styles = theme => ({
    root: {
        marginTop: 20
    },
    itemContainer: {
        backgroundColor: 'red',
        borderRadius: 25
    },
    item: {
        fontSize: 16,
        fontWeight: 500,
        marginBottom: 20,
        color: theme.palette.text.main
    }
  });
  export default styles;
